import React from "react";
import "./OrderData.scss";

const OrderData = ({ logo, sectionName, country, city, streen, zip }) => {
  return (
    <div className="order-data">

      <span className="section-title">{sectionName}</span>
      <span className="country">Country: {country}</span>
      <span className="city">City: {city}</span>
      <span className="street">Street: {streen}</span>
      <span className="zip-code">Zipcode: {zip}</span>
    </div>
  );
};

export default OrderData;
